//import './Nav.css';
import { Link } from "react-router-dom"

function Nav() {
  return (
    <div className="Nav">
        <span><Link to="/">Aashna Verma</Link></span>
        <span><Link to="/art">./art</Link></span>
        <span><Link to="/projects">./projects</Link></span>
        <span><Link to="/contact">./contact</Link></span>
        <span><Link to="/inspiration">./inspiration</Link></span>
    </div>
  );
}

export default Nav;
